-- Extensions
CREATE EXTENSION IF NOT EXISTS postgis;

-- Régions
CREATE TABLE Region
(
    reg              character varying(2) PRIMARY KEY,
    libelle          character varying(200) NOT NULL
);

COMMENT ON TABLE Region IS 'Liste des régions';

COMMENT ON COLUMN Region.reg IS 'Code région';
COMMENT ON COLUMN Region.libelle IS 'Nom en clair (typographie riche) avec article';


-- Contour des régions
CREATE TABLE Region_Contour
(
    reg     character varying(2) PRIMARY KEY REFERENCES Region (reg),
    contour geometry NOT NULL
);

COMMENT ON TABLE Region_Contour IS 'Contours des régions';

COMMENT ON COLUMN Region_Contour.reg IS 'Code région';
COMMENT ON COLUMN Region_Contour.contour IS 'Contour de la région';


